class Problem6(unittest.TestCase):
    def test_string_input(self):
        self.assertTrue(find_num_vowels('string'), 'Testing that find_num_vowels takes 1 string as input')
    def test_correct_output(self):
        self.assertEqual(find_num_vowels('aardvark'), 3)
        self.assertEqual(find_num_vowels('dfghk'), 0)
        self.assertEqual(find_num_vowels('symphony'), 1)

class Problem7(unittest.TestCase):
    def test_csv_content(self):
        ## TEST FOR GRADING:
        #with open('text1_words.csv', 'r') as t1, open('SOLUTION_text1_words.csv', 'r') as t2:
            #for line1, line2 in zip(t1, t2):
                #self.assertEqual(line1, line2, "Testing to make sure each line of content is exactly equal")
        ## TEST FOR TESTING:
        with open('text1_words.csv','r') as t1:
            lines = t1.readlines()
            line = lines[0]
            self.assertEqual(line.strip().rstrip(), "WORD,OCCURRENCES,VOWELS", "testing CSV headers")
            cleanlines = list()
            for line in lines:
                cleanlines.append(line.strip().rstrip())
            self.assertIn("YEAR,71,2".strip().rstrip(),cleanlines,"Testing that a correct line is inside the CSV file")
        t1.close()

